pragma solidity ^0.5.0;

contract MyContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public airamount;
    uint256 public airbegintime;
    uint256 public airendtime;
    uint32 public airlimitcount;
    address public airsender;
    mapping (address => uint256) public aircountof;
    uint256 public icoratio;
    uint256 public icobegintime;
    uint256 public icoendtime;
    address public icosender;
    address public icoholder;

    constructor() public {
        totalsupply = 0x15fb7f9b8c38000;
        name = "";
        symbol = "";
        decimals = 8;
        airamount = 0x5f5e100;
        airbegintime = 0x5b5bb200;
        airendtime = 0x5b5bb32c;
        airsender = 0xa0f236796BE660F1ad18F56b0Da91516882aE049;
        airlimitcount = 1;
        icoratio = 0x989680;
        icobegintime = 0x5b5bb200;
        icoendtime = 0x5bb011c4;
        icosender = 0xA89d7a553Da4E313c7F77A1F7f16B9FACF538349;
        icoholder = 0xA89d7a553Da4E313c7F77A1F7f16B9FACF538349;
        balanceof[airsender] = airamount;
        balanceof[icosender] = totalsupply;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        uint256 balance = address(this).balance;
        icoholder.transfer(balance);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        require(_value <= balanceof[_from]);
        require(_to != address(0));
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function() external payable {
        require(msg.sender != address(0));
        require(msg.value != 0);
        require((icoratio * msg.value * 10 ** uint256(decimals)) / 0xde0b6b3a7640000 <= balanceof[icosender]);
        require(now >= icobegintime && now <= icoendtime);
        uint256 tokens = (icoratio * msg.value * 10 ** uint256(decimals)) / 0xde0b6b3a7640000;
        balanceof[msg.sender] += tokens;
        balanceof[icosender] -= tokens;
        icoholder.transfer(msg.value);
    }

    function airdrop() external payable {
        require(now >= airbegintime && now <= airendtime);
        require(airamount <= balanceof[airsender]);
        require(msg.value == 0);
        if (airlimitcount > 0) {
            require(aircountof[msg.sender] < airlimitcount);
        }
        balanceof[msg.sender] += airamount;
        balanceof[airsender] -= airamount;
        aircountof[msg.sender] += 1;
    }

    function ico() external payable {
        require(((icoratio * msg.value * 10 ** uint256(decimals)) / 0xde0b6b3a7640000) > 0);
        require(((icoratio * msg.value * 10 ** uint256(decimals)) / 0xde0b6b3a7640000) <= balanceof[icosender]);
        require(msg.sender != address(0));
        require(now >= icobegintime && now <= icoendtime);
        uint256 tokens = (icoratio * msg.value * 10 ** uint256(decimals)) / 0xde0b6b3a7640000;
        balanceof[msg.sender] += tokens;
        balanceof[icosender] -= tokens;
        icoholder.transfer(msg.value);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0));
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
